import MainScreen from './screens/MainScreen'
import PricesScreen from '../src/screens/PricesScreen'
import { Routes, Route } from "react-router-dom";

function App() {
  return (
    <>

      <Routes>
        <Route index element={<MainScreen />} />
        <Route path="/prices" element={<PricesScreen />}>

        </Route>
      </Routes>

      <div className="App">
        <MainScreen />
      </div>
    </>
  );
}

export default App;
